INSERT INTO `modx_site_htmlsnippets` VALUES (1,1,0,'head','',0,0,0,'<head>\n    <meta charset=\"UTF-8\">\n    <meta name=\"viewport\" content=\"width=device-width, initial-scale=1.0\">\n    <!--        <link rel=\"icon\" href=\"/assets/resources/img/favicon.svg\">-->\n    <!--        <link rel=\"stylesheet\" href=\"/assets/resources/css/main.css\">-->\n    <script src=\"https://ajax.googleapis.com/ajax/libs/jquery/3.5.1/jquery.min.js\"></script>\n    <script src=\"/assets/resources/js/main.js\"></script>\n    <script src=\"/assets/resources/js/test.js\"></script>\n\n    <link rel=\"preconnect\" href=\"https://fonts.googleapis.com\">\n    <link rel=\"preconnect\" href=\"https://fonts.gstatic.com\" crossorigin>\n    <link href=\"https://fonts.googleapis.com/css2?family=Inter:wght@100..900&display=swap\" rel=\"stylesheet\">\n\n\n    <link rel=\"stylesheet\" href=\"/assets/resources/css/main.css\">\n\n    <title>[[*introtext]]</title>\n    <meta name=\"description\" content=\"[[*description]]\">\n\n\n<!-- Yandex.Metrika counter -->\n<script type=\"text/javascript\" >\n   (function(m,e,t,r,i,k,a){m[i]=m[i]||function(){(m[i].a=m[i].a||[]).push(arguments)};\n   m[i].l=1*new Date();\n   for (var j = 0; j < document.scripts.length; j++) {if (document.scripts[j].src === r) { return; }}\n   k=e.createElement(t),a=e.getElementsByTagName(t)[0],k.async=1,k.src=r,a.parentNode.insertBefore(k,a)})\n   (window, document, \"script\", \"https://mc.yandex.ru/metrika/tag.js\", \"ym\");\n\n   ym(97654202, \"init\", {\n        clickmap:true,\n        trackLinks:true,\n        accurateTrackBounce:true,\n        webvisor:true\n   });\n</script>\n<noscript><div><img src=\"https://mc.yandex.ru/watch/97654202\" style=\"position:absolute; left:-9999px;\" alt=\"\" /></div></noscript>\n<!-- /Yandex.Metrika counter -->\n\n</head>',0,'a:0:{}',1,'assets/base/chunks/layout/head.html'),(2,1,0,'header','',0,0,0,'<header class=\"container\">\r\n    <div class=\"header\">\r\n        <a href=\"/\" class=\"