howForm(\'/api/commercial-offer\', \'post\', \'Отправить спецификацию\', \'letter\')\">Отправить спецификацию</div>\r\n                    </div>\r\n                </div>\r\n            </div>\r\n        </div>\r\n    </div>\r\n</header>',0,'a:0:{}',1,'assets/base/chunks/layout/header.html'),(3,1,0,'footer','',0,0,0,'<footer class=\"footer\">\r\n    <div class=\"container\">\r\n        <div>\r\n            <a href=\"/\" class=\"footer-logo logo\">\r\n                <img src=\"/assets/resources/img/logo-white.svg\" alt=\"logo\">\r\n            </a>\r\n            <div class=\"footer-links\">\r\n                <a href=\"/products\">Металлорукава и РВД</a>\r\n<!--                <a href=\"#\">Рукава Высокого Давления</a>-->\r\n                <a href=\"/contacts\">Контакты</a>\r\n            </div>\r\n        </div>\r\n        <div class=\"footer-contacts\">\r\n            <div>\r\n                <a href=\"\">mail@fld.ru</a>\r\n                <a href=\"\">+7 495 984 41 00</a>\r\n            </div>\r\n            <div>\r\n                <div>г. Москва, ул. Большая Cеменовская,  д.49</div>\r\n            </div>\r\n        </div>\r\n    </div>\r\n</footer>',0,'a:0:{}',1,'assets/base/chunks/layout/footer.html'),(4,1,0,'main_page','',0,0,0,'<div class=\"main-banner\">\n    <div>\n        <h1>[[*longtitle]]</h1>\n        <h3>[[*description]]</h3>\n    </div>\n    <img alt=\"banner\" src=\"/assets/resources/img/main-banner.png\">\n</div>\n<div class=\"container main-about\">\n    <h2 class=\"main-about-head\">Изготовление металлорукавов на заказ по вашей спецификации</h2>\n    <div class=\"main-about-body\">\n        <div>\n            <div class=\"main-about-body-text\">Наша организация специализируется на изготовлении металлорукавов и рукавов высокого давления из нержавеющей стали по полному циклу производства.\n                Наличие собственной производственной базы, конструкторского отдела и квалифицированного персонала позволяет решать сложные и нестандартные задачи.</div>\n            <div class=\"btn\" onclick=\"showForm(\'/api/commercial-offer\', \'post\', \'Отправить спецификацию\', \'letter\')\">\n                Отправить спецификацию\n            </div>\n        </div>\n        <div class=\"main-about-body-img\">\n            <img src=\"/assets/resources/img/about-prod.png\" alt=\"img\">\n        </div>\n    </div>\n</div>\n<div class=\"main-cards container\">\n    <div class=\"main-cards-item\">\n        <div>Металлорукава</div>\n        <div>\n            Металлорукав полностью состоит из нержавеющей стали: внутренней сильфонной трубки, оплётки и фитингов.\n            <br>\n            Материал сильфонной трубки 321 или 316L нержавеющая сталь, материал оплётки 304L или 316L нержавеющая сталь.\n            <br>\n            Благодаря этому металлорукава обладают хорошими рабочими параметрами: Рраб до 220бар, Tраб от -200°С до +420°С, длительным сроком службы, хорошим внешним видом, высокой коррозионной стойкостью, могут быть изготовлены с различными фитингами и заданной длины. Обладают хорошей гибкостью.\n        </div>\n        <div>\n            <a class=\"btn\" href=\"/products\">Подробнее</a>\n        </div>\n    </div>\n    <div class=\"main-cards-item\">\n        <div>РВД</div>\n        <div>\n            Рукав высокого давления (РВД) состоит из внутренней полимерной трубки, армирующей оплётки и защитного покрытия.\n            <br>\n            Рабочие параметры:\n            <br>\n            Рраб до 475бар, Tраб от -70 до +260°С\n            <br>\n            Материал: PTFE, ETFE, Полиамид, нержавеющая сталь\n            <br>\n            ДУ: 6 - 12 мм, возможно изготовление ду 25 мм, 32 мм, 38 мм, 50 мм, 80 мм\n        </div>\n        <div>\n            <a class=\"btn\" href=\"/products\">Подробнее</a>\n        </div>\n    </div>\n</div>\n[[$main_text]]\n<div class=\"hide\">[[*introtext]]</div>',0,'a:0:{}',1,'assets/base/chunks/pages/main.html'),(5,1,0,'products_page','',0,0,0,'<div class=\"container prod